import React, { useEffect } from 'react';
import './App.css';
import { login } from './api/auth';
import KeywordCheck from './components/KeywordCheck';
import KeywordCheckTable from './components/KeywordCheckTable';

function App() {
  useEffect(() => {
    login();
  });
  return <>
  <KeywordCheck/>
  <KeywordCheckTable/>
  </>;
}

export default App;
